import React from 'react';
import CustomNavBar from '../components/Navbar';
import {Link} from 'react-router-dom';


const Home = () => (
    <div className='container'>
        <CustomNavBar/>
       
        <div className='mt-5 p-5 bg-light'>
            <h1 className='display-4'>Witaj w DocoApp !</h1>
            <p className='lead'>
                To wspaniała aplikacja, której celem jest pomoc w pisaniu prac naukowych z wielu dziedzin.
            </p>
            <hr className='my-4' />
            <p>Kliknij przycisk aby przejść do logowania.</p>
            <Link className='btn btn-primary btn-lg' to='/login'>Login</Link>
        </div>
    </div>
);

export default Home;
